import React from 'react'

export default function UIButton(props) {
    return (
        <button 
            className={"button-class"+(" , "+props.addClass || "")} 
            onClick={props.onClick}
            // type={props.type}
            style={{
                width:(props.width),
                margin:(props.margin)
                }}  
        >
            {props.text}
        </button>
    )
}
